import React from "react";
import '../Game.css'

function  onClick(ev,id) {
    alert("Clicked" + id);
}

const GameCircle = ({id, children}) => {
    //console.log("GameCircle", id, color);

    return <div className={`"gameCircle" ${id%2===0? "odd":"even"}`}  onClick={(ev)=>onClick(ev,id)}> 
        {children}
         </div>;
}

export default GameCircle;
